import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Objects;

public class FindAllAnagramsinaString {
    public static void main(String[] args) {
        String s = "",
                p = "";
        int sLen = s.length();
        int pLen = p.length();
        char[] pArrays = p.toCharArray();
        Arrays.sort(pArrays);
        List<Integer> result = new ArrayList<>();
        for (int i = 0; i < sLen - (pLen - 1); i++) {
            if (anagrams(s.substring(i, i + pLen), new String(pArrays))) {
                result.add(i);
            }
        }
        for (int i = 0; i < result.size(); i++) {
            System.out.println(result.get(i));
        }
    }
    private static boolean anagrams(String s, String p) {
        char[] sArrays = s.toCharArray();
        Arrays.sort(sArrays);
        String ss = new String(sArrays);
        if(!Objects.equals(p,ss)) return false;
        return true;
    }
}
